import React from 'react';

const Homepage = () => {
  return (
    <div>
       <h1>Mental Health</h1>
       <div id='map'>
	       <iframe
			  width="600"
			  height="450"
			  frameborder="0" style="border:0"
			  src="https://www.google.com/maps/embed/v1/place?key=AIzaSyD7E2A6vrmhI4LKrK5SKeYTkB-JZ2Zxtd8
			    &q=Space+Needle,Seattle+WA">
			</iframe>
		</div>
    </div>
  );
};

export default Homepage;
